import React, { Component } from 'react'

export class Head extends Component {

    HeadStyle =  {
        position: 'relative',
        display: 'flex',
        border: '1px dotted red',
        alginItems: 'center',
        justfyContent: 'center'

    }

    render() {
        return (
            <div style = { this.HeadStyle }>
                Primeiro Componente
            </div>
        )
    }
}

export default Head
